import { Routes, Route } from "react-router-dom";
import Header from "./components/Header/Header";
import NotFound from "./components/NotFound"
function App() {
  return (
    <div>
        <Header />
        <Routes>
          <Route path="*" element={<NotFound />} />
        </Routes>
    </div>
  );
}

export default App;
